import React from "react";

function Header() {
  return (
    <header className="header">
      <h1>Daily Recommendations</h1>
      <nav>
        <ul>
          <li><a href="#home">Home</a></li>
          <li><a href="#settings">Settings</a></li>
          <li><a href="#share">Share</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
